// styles
import './Todo.scss'

// icons 
import CloseIcon from '@mui/icons-material/Close'

function Todo(props) {

    const {completed, text} = props.todo

    return (
        <div className='todo'>
            
            <input
                className='todo__checkbox'
                type='checkbox'
                checked={completed}
            />

            <span className>
                {text}
            </span>

            <CloseIcon
                className='todo__closeBtn'
            />
    
        </div>
    )
}

export default Todo
